import React from 'react'

const Index = () => {
    return (
        <div className='bg-gray-200 py-4'>
        <h1>
            <img className='h-24 mx-auto' src='./logo.png' alt='logo'height='60' />
        </h1>
        <div className='bg-gray-500'>NavBar</div>
        </div>
    )
}

export default Index
